import React, { Component } from "react";

class NaviDisplay extends Component {
  render() {
    return (
      <div className="navidisplay">
        <ul>
          <li>Home</li>
          <li>About</li>
          <li>Portfolio</li>
          <li>Contact</li>
        </ul>
        <div className="navidisplay__back" />
      </div>
    );
  }
}

export default NaviDisplay;
